import React from "react";
import styled from "styled-components";

const Wrapper = styled.div`
  display: flex; 
  height: 24px;
  align-items: center;
  font-size: 1.3125rem;
`;
const Symbol = styled.span`
  display: block;
  font-weight: 700;
  margin-right: 6px;
`;
const Amount = styled.span`
  display: block;
  font-weight: 700;
`;

function WalletIcon() {
  return (
    <Wrapper>
      <Symbol className="text-body">$</Symbol>
      <Amount className="text-body">9.07</Amount>
    </Wrapper>
  );
}

export default WalletIcon;
